var muObjArray = new Array();
var headLoadIf = false;
onmessage = function(event) {   
	var m_obj = event.data;     
	var m_action = m_obj.action;
	var m_page = m_obj.page;
	if(m_action=="initHeader")
	{        
		Module._main();
		var m_headerUrl = m_obj.hurl; 
		var hps = m_obj.hps;
		var m_page = m_page; 
		var m_index = m_obj.index;
		var thumb = m_obj.thumb;
		var m_oReq = new XMLHttpRequest();		
		m_oReq.open("GET", m_headerUrl, true);
		m_oReq.responseType = "arraybuffer";
		m_oReq.addEventListener("progress", function (evt) {
			var m_percentComplete = evt.loaded / (parseInt(m_obj.hl)+parseInt(m_obj.pl));
			var resObj = new Object();
			resObj.action = "loadProgress";
			resObj.page = m_page;
			resObj.percent = m_percentComplete;
			postMessage(resObj);   
		}, false);
		m_oReq.onload = function(m_oEvent){  
			var m_blobh = new Blob([m_oReq.response], {
				type: "application/ebt"
			});
			
			var m_filesh = {};
			m_filesh[0] = m_blobh;
			var m_readerh = new FileReader();
			m_readerh.onload = function(m_e){    
			      

				var m_buf = new Uint8Array(m_e.target.result);   
		        var m_pBuf = null;
		        try
		        {
					m_pBuf = Module._malloc(m_buf.length);    
		        }
		        catch(e)
		        {  
		        	var resObj = new Object();  
					resObj.action = "initError";
					resObj.error = e;  
					resObj.debug = e;  
					resObj.page = m_page;  
					postMessage(resObj);    
					return;
		        }

				HEAPU8.set(m_buf.subarray(0, m_buf.length), m_pBuf);  

				var m_muObj = XDFJS.C.MuJS_Doc_new(hps, m_pBuf, m_buf.length); 

				muObjArray[m_index] = m_muObj;
				var resObj = new Object();  
				
				resObj.action = "headerLoadOk";
				resObj.page = m_page;  
				resObj.thumb = thumb;
				postMessage(resObj);  
				headLoadIf = true;  
			};
			m_readerh.readAsArrayBuffer(m_filesh[0]);
		};
		m_oReq.send();
	}
	else if(m_action=="getPage")
	{
		var m_img = m_obj.img;
		var m_pageUrl = m_obj.purl;   
		var m_index = m_obj.index; 
		var thumb = m_obj.thumb;
		var textState = m_obj.textState;
		var m_oReq1 = new XMLHttpRequest();
			m_oReq1.open("GET", m_pageUrl, true);
			m_oReq1.responseType = "arraybuffer";
			m_oReq1.addEventListener("progress", function (evt) 
			{
			       
			    var m_percentComplete = (parseInt(m_obj.hl)+evt.loaded) / (parseInt(m_obj.length)+parseInt(m_obj.hl));
		       	var resObj = new Object();
				resObj.action = "loadProgress";
				resObj.page = m_page; 
				resObj.thumb = thumb;
				resObj.percent = m_percentComplete;
				postMessage(resObj);    
				
            }, false);
			m_oReq1.onload = function(oEvent){
				var m_blob1 = new Blob([m_oReq1.response], {
					type: "application/ebt"
				});
				var m_files = {};
				m_files[0] = m_blob1;
				var m_reader1 = new FileReader();
				m_reader1.onload = function(m_e){
					var m_buf1 = new Uint8Array(m_e.target.result);
					devicePixelRatio =  m_obj.dp;
					var m_width_d = m_obj.width_d;
					var m_height_d = m_obj.height_d;
					var m_muObj = muObjArray[m_index];	     
					var m_width = m_obj.width;
					var m_height = m_obj.height;
					var width =  m_width_d*devicePixelRatio;
					var height =  m_height_d*devicePixelRatio;       
					
				
					var m_pBuf1 = Module._malloc(m_buf1.length);
					HEAPU8.set(m_buf1.subarray(0, m_buf1.length), m_pBuf1);
					XDFJS.C.MuJS_Doc_add_page(m_muObj, m_page, m_width, m_height, m_pBuf1, m_buf1.length);
					Module._free(m_pBuf1);        				

					var m_bitmap = XDFJS.C.MuJS_Page_get_bitmap_patch(m_muObj, m_page, width,height,0,0,width,height);
				
					var m_buf = XDFJS.C.MuJS_Bitmap_get_buffer(m_bitmap);
					var m_show_width = XDFJS.C.MuJS_Bitmap_get_width(m_bitmap);
					var m_show_height = XDFJS.C.MuJS_Bitmap_get_height(m_bitmap);
					
					if (m_show_width <= 0) {
						m_show_width = width;
					}
					if (m_show_height <= 0) {
						m_show_height = height;
					} 
					var m_data = m_img.data;
					var m_off = 0;
					for (var m_h = 0; m_h < m_show_height; ++m_h) {
						var m_ptr = m_buf + m_show_width * 4 * m_h;
						for (var m_w = 0; m_w < m_show_width; ++m_w) {
							m_data[m_off++] = HEAPU8[m_ptr + 0];
							m_data[m_off++] = HEAPU8[m_ptr + 1];
							m_data[m_off++] = HEAPU8[m_ptr + 2];
							m_data[m_off++] = HEAPU8[m_ptr + 3];
							m_ptr += 4;
						}
					}         
				
					XDFJS.C.MuJS_Bitmap_destroy(m_muObj, m_bitmap);
					var m_text = null;
					var m_text_buf =  null;
					var m_text_counts =  0;
					var m_text_rects =  null;
					var text_rect_str = "";
					var text_rect_num = "";
					var text_rect = {};	         
					var text_rect_ori = {};	
					var text_rect_ori_str = "";   
					var text_str = "";
					var text = {};	
					var text_num = 0;
					if(textState==1)
					{
						m_text = XDFJS.C.MuJS_Page_get_text(m_muObj, m_page);
						m_text_buf = XDFJS.C.MuJS_Bitmap_get_text_values(m_text);
						m_text_counts = XDFJS.C.MuJS_Bitmap_get_text_counts(m_text); 
						m_text_rects = XDFJS.C.MuJS_Bitmap_get_buffer_rects(m_text);  
           
					}
					
			     
			        if(textState==1)
			        {
						for(var i=0;i<m_text_counts*4;i++)
						{
							text1 = HEAPU8[m_text_buf + i+1].toString(16);    
							text2 = HEAPU8[m_text_buf + i].toString(16);    
							if(text1.length==1)
							{
								text1 = "0"+text1;
							}  
							if(text2.length==1)
							{
								text2 = "0"+text2;
							}
							i++;i++;i++;
							var unicode = "\\u"+text1+text2; 
							text_str = text_str+unicode;      
						} 
							  
						for(var i=0;i<m_text_counts*16;i++)
						{
										
							text_rect_ori[text_num] = HEAPU8[m_text_rects + i]+","+HEAPU8[m_text_rects + i+1]+","+HEAPU8[m_text_rects + i+2]+","+HEAPU8[m_text_rects + 3];
							var r1 = "00000000"+HEAPU8[m_text_rects + i+3].toString(2);
							var r2 = "00000000"+HEAPU8[m_text_rects + i+2].toString(2)  
							var r3 = "00000000"+HEAPU8[m_text_rects + i+1].toString(2)  
							var r4 = "00000000"+HEAPU8[m_text_rects + i].toString(2);     
						   
							r1 = r1.substring(r1.length-8); 
							r2 = r2.substring(r2.length-8);
							r3 = r3.substring(r3.length-8);
							r4 = r4.substring(r4.length-8);  
							var r = r1+r2+r3+r4;     
							i++;i++;i++;    
							text_rect[text_num] = parseInt(r,2); 
						 
							text_num++;  
						}     
						for(var i=0;i<text_num;i++)
						{     
						  text_rect_str =text_rect_str+text_rect[i]+","+text_rect[i+1]+","+text_rect[i+2]+","+text_rect[i+3]+";"; 
						  text_rect_ori_str = text_rect_ori_str+text_rect_ori[i]+";";
						  i++;i++;i++; 
						} 
						XDFJS.C.MuJS_Text_destroy(m_muObj, m_text);   
					}
					 
					XDFJS.C.MuJS_Doc_delete_page(m_muObj,m_page);
					var resObj = new Object();
					resObj.action = "pageLoadOk";
					resObj.page = m_page;
					resObj.img = m_img; 
					resObj.width = m_show_width;   
					resObj.thumb = thumb;
					resObj.height = m_show_height; 
					resObj.curpage = m_obj.curpage;
					resObj.text_if = textState;
					if(textState==1)
					{
						resObj.text = text_str;
						resObj.text_num = m_text_counts;
						resObj.text_rect = text_rect_str;    
						resObj.text_rect_ori = text_rect_ori_str;
						
						console.log(text_str)
					}
					postMessage(resObj);   
				
				};
				m_reader1.readAsArrayBuffer(m_files[0]);
			};
			m_oReq1.send();
	}	
} 
